import "./App.css";
const imgPokemon = require("./logo.jpeg");

const App = () => (
    <div className="App container">
        <div className="row">
            <div className="col-12">
                <div className="card mt-5" style={{ maxWidth: "370px" }}>
                    <div className="row no-gutters">
                        <div className="col-4">
                            <img src={imgPokemon} />
                        </div>
                        <div className="col-8"></div>
                    </div>
                </div>
            </div>
        </div>
    </div>
);

export default App;
